 createRelatorio = () =>{
  var grafs=dataDashboard.dashboard.dados,num=1,boxRel=document.getElementById('box-relatorio');
  boxRel.innerHTML='';
  var nCard=1;
  for(var ob of grafs){
    if(ob.tipo_pergunta!='NET_PROMOTER_SCORE'){
      var htmlRel= `<div id='numCard${nCard++}' class="box-responsivo card mb-3 card-padrao">
      <h4>${num} - ${ob.titulo}</h4>`;
      if(ob.tipo_pergunta=='ESCALA_LIKERT_0_10'){
        htmlRel += `<div class="nav">`;
          for(var it of ob.label){
            htmlRel += htmlBoxMedia(it);
          }
        htmlRel += `</div>`;
      }
      htmlRel += `<div style="width:100%;${!parseInt(dashMensuracao)&&ob.tipo_pergunta=='ABERTA'?'':'height: 500px;'}margin: auto;" id="rel${num}"></div>
      <div id="rel${num}Descricao"></div>
      </div>`;
      var div = document.createElement('div');
      div.innerHTML=htmlRel;
      boxRel.appendChild(div);
      if(parseInt(dashMensuracao)){
        gGrafMenuracao('rel'+num,JSON.stringify(ob));
      }else{
        gGraf('rel'+num,JSON.stringify(ob));
      }
      num++;
    }else{
      var html =``;
      if(parseInt(dashMensuracao)){
        html += `<div id='numCard${nCard++}' class="box-responsivo card mb-3 card-padrao">
        <h4>${num} - ${ob.titulo}</h4>
        <h5>NPS - Net Promoter Score:</h5>
        <div style="width:100%;height: 500px;margin: auto;" id="mRelGrafNPS"><div class="loader" style="margin-top: 60px"></div></div>
               <div>
                   <img style="width: 100%;" src="data:image/png;base64,
                          
                          
                          ">
               </div>
               <h5 class="mt-2">Classificação dos clientes:</h5>
               <div style="width:100%;height: 500px;margin: auto;" id="mRelGrafNPS2"><div class="loader" style="margin-top: 60px"></div></div>
               <div id="mRelGrafNPSDescricao"></div>
               </div>`;
               var div = document.createElement('div');
               div.innerHTML=html;
               boxRel.appendChild(div);
        // document.getElementById('divNPS').innerHTML = html;
        gGrafMenuracao('mRelGrafNPS',dataDashboard.dashboard.dadosNPS);
      }else{
        html += `<div  class="card mb-3 card-padrao">
        <h4>${num} - ${ob.titulo}</h4>
        <div  id="relGrafNPS"><div class="loader" style="margin-top: 60px"></div></div>
        <div class='mt-2' id="relGrafNPSDescricao"></div>
        </div>`;
        var div = document.createElement('div');
        div.innerHTML=html;
        boxRel.appendChild(div);
        // document.getElementById('divNPS').innerHTML = html;
        gGraf ('relGrafNPS',dataDashboard.dashboard.dadosNPS);
      } 
    }
  }
}

createEntrevistas = () =>{
  var dashboard=dataDashboard.dashboard,htmlEnt='';
  if(parseInt(dashMensuracao)){
    for(var dk in dashboard.totalEntrevistasDia){

      htmlEnt += `<h6>M${dk}</h6>
      <table class="table table-bordered">
            <thead>
              <tr><th style="text-align: center;width:50%">Data</th><th  style="text-align: center;">Quantidade</th></tr>
            <tbody>`;
            var numTotal=0;
            for(var d in dashboard.totalEntrevistasDia[dk]){
              numTotal+= dashboard.totalEntrevistasDia[dk][d];
              htmlEnt += `<tr><td align="center">${d}</td><td align="center">${dashboard.totalEntrevistasDia[dk][d]}</td></tr>`;
            }
            htmlEnt += `<tr><td align="center">Total</td><td align="center">${numTotal}</td></tr>
          </tbody>
        </table>`;
    }
  }else{
     htmlEnt += `<table class="table table-bordered">
              <thead>
                <tr><th style="text-align: center;width:50%">Data</th><th  style="text-align: center;">Quantidade</th></tr>
              <tbody>`;
              var numTotal=0;
              for(var d of dashboard.totalEntrevistasDia){
                numTotal+= d.total;
                htmlEnt += `<tr><td align="center">${d.data}</td><td align="center">${d.total}</td></tr>`;
              }
              htmlEnt += `<tr><td align="center">Total</td><td align="center">${numTotal}</td></tr>
            </tbody>
          </table>`;
  }
  document.getElementById('list-entrevistas').innerHTML =htmlEnt;
}

createEntrevistasRealizadas = () =>{
  var dashboard=dataDashboard.dashboard,htmlEntReal='';
  if(parseInt(dashMensuracao)){
    if(Object.keys(dashboard.dataEntrevistas).length){
      for(dt in dashboard.dataEntrevistas){
        htmlEntReal += `<h5 class="${dt>=2?'pt-3':''}" >M${dt}</h5> `;
        for(d of dashboard.dataEntrevistas[dt]){
          htmlEntReal += ` 
          <a data-i="{{$key+1}}"  class="sm-link list-group-item d-flex justify-content-between bd-highlight">
            <div>
              <span  class="ui-icon ui-icon-circle-arrow-e"></span>`;
              if(d.tipo=='MOBILE'){
                htmlEntReal += `<span style="padding-left: 0px;padding-right: 1px;"><i data-toggle="reali" title="Entrevista realizada em um dispositivo mobile" class="fas fa-mobile-alt"></i></span>`;
              }else{
                htmlEntReal += `<span style="font-size:11px;"><i data-toggle="reali"  title="Entrevista realizada no navegador"  class="fas fa-window-maximize"></i></span>`;
              }
              htmlEntReal +=` ${d.titulo}
              </div>
            <div>
              <button type="button" class="btn btn-primary btn-sm" style="padding: 4px" onclick="verEntrevista(${d.id},'${d.titulo}','${d.longitude}','${d.latitude}')"  ><i class="fa fa-eye"></i> <span class="alterar">ENTREVISTA</span></button>
            </div>
          </a>`;
        }
      }
    }
  }else{
   if(dashboard.dataEntrevistas.length){
    for(d of dashboard.dataEntrevistas){
      htmlEntReal += ` 
      <a data-i="{{$key+1}}"  class="sm-link list-group-item d-flex justify-content-between bd-highlight">
        <div>
          <span  class="ui-icon ui-icon-circle-arrow-e"></span>`;
          if(d.tipo=='MOBILE'){
            htmlEntReal += `<span style="padding-left: 0px;padding-right: 1px;"><i data-toggle="reali" title="Entrevista realizada em um dispositivo mobile" class="fas fa-mobile-alt"></i></span>`;
          }else{
            htmlEntReal += `<span style="font-size:11px;"><i data-toggle="reali"  title="Entrevista realizada no navegador"  class="fas fa-window-maximize"></i></span>`;
          }
          htmlEntReal +=` ${d.titulo}
          </div>
        <div>
          <button type="button" class="btn btn-primary btn-sm" style="padding: 4px" onclick="verEntrevista(${d.id},'${d.titulo}','${d.longitude}','${d.latitude}')"  ><i class="fa fa-eye"></i> <span class="alterar">ENTREVISTA</span></button>
        </div>
      </a>`;
    }
   }
  }
  if(!htmlEntReal){
    htmlEntReal += ` 
    <a data-i=""  class="sm-link list-group-item d-flex justify-content-between bd-highlight">
    Nenhum registro foi encontrado
    </a>
    `;
   }
    document.getElementById('list-entrevistas-realizadas').innerHTML =htmlEntReal;
}

