function initMap() {
  var dashboard=dataDashboard.dashboard;
    map = new google.maps.Map(document.getElementById('map'), {
    center:localizacao,
    zoom: 8,
    streetViewControl: false,
    // mapTypeId: 'coordinate',
      mapTypeControlOptions: {
        mapTypeIds: ['coordinate', 'roadmap'],
        // style: google.maps.MapTypeControlStyle.DROPDOWN_MENU
      }
    });

  var image = 'https://www.appop.com/op/public/assets_gestor/img/list-marker.png';
  if(parseInt(dashMensuracao)){
    for(var ident in dashboard.dataEntrevistas){
      for(var ob of dashboard.dataEntrevistas[ident]){
        var ponto = new google.maps.LatLng(ob.latitude, ob.longitude);
        var beachMarker = new google.maps.Marker({
          position:ponto,
          map: map,
          title:ob.titulo,
          icon: image
        });
        attachSecretMessage(beachMarker, ob);
      }
    }
  }else{
    for(var ob of dashboard.dataEntrevistas){
      var ponto = new google.maps.LatLng(ob.latitude, ob.longitude);
      var beachMarker = new google.maps.Marker({
        position:ponto,
        map: map,
        title:ob.titulo,
        icon: image
      });
      attachSecretMessage(beachMarker, ob);
    }
  }
}

function attachSecretMessage(marker, o) {
  var infowindow = new google.maps.InfoWindow({
    content: `<h5>Entrevista:</h5>
                ${o.titulo} <br/> 
  <button type="button" class="btn btn-secondary btn-sm" style="padding:2px;margin-top:5px" onclick="verEntrevista(${o.id},'${o.titulo}','${o.longitude}','${o.latitude}')" >
      <b>Ver entrevista</b>
    </button>`
  });

  marker.addListener('click', function() {
    infowindow.open(marker.get('map'), marker);
  });
}


function loadAbas(){
  var abas={'indicadores':createIndicadores,'net-promoter-score':createNPS,'relatorio':createRelatorio,
             'entrevistas':createEntrevistas,'entrevistas-realizadas':createEntrevistasRealizadas,
             'geolocalizacao':createGeolocalizacao
          };

    abas[abaAtual]();
    for(var i in abas){
      if(i!=abaAtual){
        abas[i]();
      }
    }
}

loadAbas();